def main():
	n, k = list(map(int, input().split()))
	line = input()
	pos = [0] * n
	for i in range(n):
		if line[i] == '#':
			pos[i] = i + k
			i += k
	jump = []
	for i in range(n):
		if pos[i]!= i + k:
			jump.append(i)
	if len(jump) == 1:
		print("YES")
	else:
		for i in jump:
			if pos[i] == i + k:
				print("YES")
				return
		print("NO")


